import {useReactTable} from "@tanstack/react-table";
import React ,{ useState } from "react";
import DATA from "../data";

const Table = () => {
    const [data,setData] = useState(DATA);
    const table = useReactTable({
        data
    })
    return table;
};

export default Table;
